import styles from './Login.module.css'
import TextBox from '../TextBox/TextBox'
function Login()
{
    return(
        <div className={styles.mainPage}>
        <div className={styles.pageHeader}>
            Login to Your Accout
        </div>
        <TextBox type="text" />
        <TextBox type="password" />
        </div>
    )
}

export default Login
